import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { Link } from 'react-router-dom'; 

function Viewproj() {
  const [projects, setProjects] = useState([]);

  useEffect(() => {
    axios.get('http://localhost:9000/getProjects')
      .then(response => {
        setProjects(response.data);
      })
      .catch(error => {
        console.error('Error fetching projects:', error);
      });
  }, []);

  return (
    <div>
      <h2>View All Projects</h2>
      <ul>
        {projects.map(project => (
       <li key={project.project_id}>
       Project Name: {project.project_name}<br />
       Project Description: {project.description}<br />
       Manager: {project.manager_details.f_Name} {project.manager_details.l_Name}<br />
       Owner: {project.owner_details.f_Name} {project.owner_details.l_Name}<br />
       Team: {project.teams_details.team_name}<br />
     </li>
   ))}
 </ul>
        <Link to="/">
        <button >Go back</button>
      </Link>

      </div>
);
}
export default Viewproj;
